<script setup lang='ts'>
import router from '@/router';
import { ElMessage } from 'element-plus';
import { gsap, Linear } from 'gsap';
import { onMounted } from 'vue';

onMounted(() => {
    gsap.to("#rocket", {
        duration: 6,
        repeat: -1,
        ease: Linear.easeNone,
        motionPath: {
            path: "#rocket-path", // 沿着轨迹运动
            align: "#rocket-path",
            autoRotate: true,
            alignOrigin: [0.5, 0.5]
        }
    });
    gsap.to("#rocket-path", {
        duration: 8,
        repeat: -1,
        ease: "back.out(1.7)",
        rotation: 180,
        transformOrigin: '50% 50%'
    });
    gsap.to("#star", {
        duration: 6,
        repeat: -1,
        ease: Linear.easeIn,
        motionPath: {
            path: "#star-path", // 沿着轨迹运动
            align: "#star-path",
            autoRotate: true,
            alignOrigin: [0.5, 0.5]
        }
    });
    gsap.to("#earth", {
        duration: 10,
        repeat: -1,
        ease: Linear.easeNone,
        motionPath: {
            path: "#earth-path", // 沿着轨迹运动
            align: "#earth-path",
            autoRotate: true,
            alignOrigin: [0.5, 0.5]
        }
    });
});

// 点击事件
const onClick = function () {
    ElMessage({
        message: '该功能尚未开发',
        type: 'error'
    });
};

// 跳转到主页
const onIndexBtnClick = function () {
    router.push('/index');
}
</script>

