    }

    50% {
        border-color: currentColor;
    }
}

/* 关键帧动画 */
@keyframes bg-linear {
    0% {
        background-position: 0%;
    }

    100% {
        background-position: 400%;
    }
}

/* 路径长度渐变动画 */
@keyframes path-length {
    0% {
        stroke-dasharray: 5 5;
    }

    20% {
        stroke-dasharray: 5 50;
    }

    30% {
        stroke-dasharray: 20 25;
    }

    40% {
        stroke-dasharray: 25 15;
    }

    50% {
        stroke-dasharray: 30 10;
    }

    60% {
        stroke-dasharray: 20 10;
    }

    70% {
        stroke-dasharray: 12 10;
    }

    80% {
        stroke-dasharray: 10 5;
    }

    100% {
        stroke-dasharray: 5 5;
    }
}

/* 透明度渐变 */
@keyframes opacity {
    0% {
        opacity: 0%;
    }

    50% {
        opacity: 100%;
    }

    100% {
        opacity: 0%;
    }
}

@keyframes logo {
    0% {
        transform: none;
    }

    50% {
        transform: scale(1.2);
    }

    100% {
        transform: none;
    }
}

section {
    position: relative;
    top: 30%;

    .rainbow-btn {
        color: rgba(255, 255, 255, 0.8);
        text-transform: uppercase;
        font-weight: 700;
        font-size: 24px;
        display: inline-block;
        width: 190px;
        position: relative;
        height: 50px;
        border-radius: 33px;
        text-align: center;
        line-height: 50px;
        transition: all .4s;
        z-index: 2;
        left: 20.5%;
        transform: translate(-50%, -50%);
        cursor: pointer;
        background: linear-gradient(90deg, #03a9f4, #f441a5, #ffeb3b, #03a9f4);
        background-size: 400%;
        animation: bg-linear 8s linear infinite;

        &+.rainbow-btn {
            margin-left: 18px;
        }

        #bird {
            position: absolute;
            top: -40px;
            right: -15px;
        }
    }

    .introductory {
        color: #333;
        font-size: 2em;
        width: 8em;
        height: 1.5em;
        border-right: 1px solid transparent;
        animation: typing 2s steps(16, end), blink-caret .75s step-end infinite;
        font-family: Consolas, Monaco;
        word-break: break-all;
        overflow: hidden;
        position: absolute;
        top: -80px;
        left: 25%;
        transform: translate(-50%, -50%);
    }

    .svg-container {
        width: 500px;
        height: 500px;
        position: absolute;
        z-index: 2;
        left: 50%;
        transform: translateY(-300px);

        .svg-icon {
            position: absolute;
            width: 60px;
            height: 60px;
            z-index: 2;

            &#moon {
                left: 0;
                top: 10%;
                animation: opacity 5s ease-in-out infinite;
            }
        }

        .svg-path {
            position: absolute;
            left: 0;
            top: 0;

            &.outer-path {
                .colored {
                    stroke: var(--indexOuterStroke);
                }
            }
            #earth-path {
                animation: path-length 5s ease-in-out infinite;
            }
        }

        #headshot {
            position: absolute;
            left: 190px;
            top: 190px;
            width: 120px;
            height: 120px;
            border-radius: 50%;
            box-shadow: 0 0 4px 3px var(--shadow);
            cursor: pointer;
            background-repeat: no-repeat;
            background-size: contain;
            display: flex;
            align-items: center;
            justify-content: center;
            overflow: hidden;
            animation: logo 5s ease-in-out infinite;

            &:hover {
                filter: none;
                transform: scale(1.2);
                animation: none;
            }
        }
    }
}

footer {
    svg {
        position: absolute;
        bottom: 0;
        display: block;
    }

    .path-0 {
        animation: pathAnim-0 4s;
        animation-timing-function: linear;
        animation-iteration-count: infinite;
    }

    .path-1 {
        animation: pathAnim-1 4s;
        animation-timing-function: linear;
        animation-iteration-count: infinite;
    }
}

